import React from 'react';
import Header from './components/Header';
import Players from './components/Players';

function App() {
  return (
    <main>
      <Header></Header>
      <div id="game-container">
        <ol id="players">
          <Players initialName="Player1" Symbol="X"></Players>
        </ol>
      </div>
    </main>

  );
}

export default App;
